import "./promo.css";


const Promo = () => {
  return (
    <section class="promo">
      <div class="section">
        <div class="intro">
          <div class="container1">
            <div class="intro__inner">
              <h2 class="intro__suptitle">Welcome to</h2>
              <h1 class="intro__title"> Mishka Van</h1>

            </div>
          </div>

    </div>
    
  </div>
    </section>
  );
};

export default Promo;
